class ProjectDepartmentResponseModel {  List<ProjectDepartmentModel>? data;  ProjectDepartmentResponseModel({this.data});  ProjectDepartmentResponseModel.fromJson(List<dynamic>? json) {    if (json != null) {      data = <ProjectDepartmentModel>[];      json.forEach((v) {        data!.add(new ProjectDepartmentModel.fromJson(v));      });    }  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = new Map<String, dynamic>();    if (this.data != null) {      data['Data'] = this.data!.map((v) => v.toJson()).toList();    }    return data;  }}class ProjectDepartmentModel {  int? departmentId;  String? departmentName;  String? slug;  bool? isSelected;  ProjectDepartmentModel({this.departmentId, this.departmentName, this.slug, this.isSelected = false});  ProjectDepartmentModel.fromJson(Map<String, dynamic> json) {    departmentId = json['department_id'];    departmentName = json['department_name'];    slug = json['slug'];    isSelected = false;  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = new Map<String, dynamic>();    data['department_id'] = this.departmentId;    data['department_name'] = this.departmentName;    data['slug'] = this.slug;    return data;  }}